import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppComponent } from './app.component';
import { CantantesComponent } from './Cantantes/cantante.component';
import { CartasModule } from './cartas/cartas.module';
import { OnePieceModule } from './onepiece/onepiece.module';
import { EjemploComponent } from './prueba/ejemplo/ejemplo.component';

@NgModule({
  declarations: [
    AppComponent,
    CantantesComponent,
    EjemploComponent,
  ],
  imports: [
    BrowserModule,
    CartasModule,
    OnePieceModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
